import {
  Avatar,
  Button,
  Fab,
  Modal,
  styled,
  TextField,
  Tooltip,
  Typography,
  Stack,
} from "@mui/material";
import React, { useState } from "react";
import { useDispatch } from 'react-redux';
import { Add as AddIcon } from "@mui/icons-material";
import { Box } from "@mui/system";
import imgNone from "../assets/imgNone.jpg"
import axios from 'axios';

export const uploadPost = (postData) => {
  return async (dispatch) => {
    try {
      // Envia a requisição POST para o endpoint adequado no backend
      const response = await axios.post('posts/', postData);

      // Verifica se a requisição foi bem-sucedida
      if (response.status === 201) {
        // Se sim, despacha uma ação de sucesso com os dados do post
        dispatch({ type: 'UPLOAD_POST_SUCCESS', payload: response.data });
      } else {
        // Se houver algum problema com a requisição, despacha uma ação de falha com uma mensagem de erro
        dispatch({ type: 'UPLOAD_POST_FAIL', payload: 'Erro ao enviar o post.' });
      }
    } catch (error) {
      // Se ocorrer um erro durante a requisição, despacha uma ação de falha com a mensagem de erro recebida
      dispatch({ type: 'UPLOAD_POST_FAIL', payload: error.message });
    }
  };
};

const SytledModal = styled(Modal)({
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
});

const UserBox = styled(Box)({
  display: "flex",
  alignItems: "center",
  gap: "10px",
  marginBottom: "20px",
});

const Add = () => {
  const [open, setOpen] = useState(false);

  const [postPicture, setPostPicture] = useState(imgNone);
  const [descricao, setDescricao] = useState("Sem Descrição");

  const dispatch = useDispatch();

  const handleDescricaoChange = (event) => {
    setDescricao(event.target.value);
  };

  const handleSubmit = () => {
    dispatch(uploadPost({ image: postPicture, comment: descricao }));
    setOpen(false);
  };

  const handleFileChange = (event) => {
    const file = event.target.files[0];

    if (file) {
      const imageUrl = URL.createObjectURL(file);
      setPostPicture(imageUrl);
    }
  };

  return (
    <>
      <Tooltip
        onClick={(e) => setOpen(true)}
        title="Postar"
        sx={{
          position: "fixed",
          bottom: 20,
          left: { xs: "calc(50% - 25px)", md: 30 },
        }}
      >
        <Fab color="primary" aria-label="add">
          <AddIcon />
        </Fab>
      </Tooltip>
      <SytledModal
        open={open}
        onClose={(e) => setOpen(false)}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box
          bgcolor={"white"}
          color={"text.primary"}
          p={3}
          borderRadius={5}
          sx={{ width: 600, height: "auto"}}
        >
          <Typography variant="h5" color="gray" textAlign="center">
            Criar Post
          </Typography>
          <UserBox>
            <Avatar
              src="https://images.pexels.com/photos/846741/pexels-photo-846741.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
              sx={{ width: 30, height: 30 }}
            />
            <Typography fontWeight={500}>
              John Doe
            </Typography>
          </UserBox>
          <Box >
            <Stack spacing={2} 
              sx={{  display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              flexDirection: 'column',
              }}>
              <img
                src={postPicture}
                alt="Imagem selecionada"
                style={{ width: "50%", height: "50%" }}
              />
              <input
                accept="image/*"
                style={{ display: "none" }}
                id="contained-button-file"
                type="file"
                onChange={handleFileChange}
                />
              <label htmlFor="contained-button-file">
                <Button variant="contained" component="span">
                  Escolher Imagem
                </Button>
              </label>
            </Stack>
          </Box>
          
          <Box>
            <TextField
              sx={{ width: "100%", marginTop: '10px'}}
              id="standard-multiline-static"
              multiline
              rows={3}
              placeholder="Descrição"
              variant="standard"
              value={descricao}
              onChange={handleDescricaoChange}
            />
          </Box>
          
          <Button fullWidth variant="contained" sx={{ marginTop: '10px' }} onClick={handleSubmit}>Postar</Button>
        </Box>
      </SytledModal>
    </>
  );
};

export default Add;
